// src/components/HomePage.js
import React from 'react';
import { Link } from 'react-router-dom';
import logoImage from './synchrony-logo-1.png';
import './HomePage.css';
import Navbar from './Navbar';

function HomePage() {
  return (
    <div className="homepage">
      <Navbar />
      <header className="homepage-header">
        <img src={logoImage} alt="Synchrony Financial Logo" className="homepage-logo" />
      </header>
      <main className="homepage-main">
        <h1>Synchrony Interviews</h1>
        <section className="homepage-content">
          <nav className="homepage-navigation">
            <Link to="/interviews" className="nav-link">Interviews</Link>
            <Link to="/new-interview" className="nav-link">New Interview</Link>
            <Link to="/edit-templates" className="nav-link">Edit Templates</Link>
            <Link to="/data-analysis" className="nav-link">Data Analysis</Link>
          </nav>
        </section>
      </main>
      <footer className="homepage-footer">
        <div className="footer-content">
          <div className="company-info">
            <p>Â© 2023 Synchrony, All Rights Reserved.</p>
          </div>
          <div className="contact-info">
            <p>+1 (234) 567-890</p>
            <p>contact@synchrony.com</p>
            <p>123 Synchrony Blvd, Finance City</p>
          </div>
        </div>
      </footer>
    </div>
  );
}

export default HomePage;
